import React from "react";
import {connect} from 'react-redux';
import { setMode } from '../../redux/action/action';
import PropTypes from 'prop-types';
import "../../styles/header-mobile.css";


const HeaderMobile = ({show, handleShow, main_link, ...props}) => {
    const handleNavigation = (link) => {
        window.location.href = `#${link}`
        handleShow()
    }
    const handleViewMode = () => {
        props.setMode(!props.dark)
        handleShow()
    }
    return(
        <div className = {`menu-mobile ${show ? ` menu-mobile-visible` : ``}`}>
            <div className = "nav-mobil-container">
                <div className = "menu-mobile-header">
                    <div className = "mobile-header-title">Menu</div>
                    <button onClick = {()=> handleShow()}  className = "mobile-header-icon"><i className ="fas fa-times"></i></button>
                </div>
                <div className = "nav-mobile">
                    <div className = "nav-item-mobile">
                        <button onClick = {()=>window.location.href = "/"} className = {`nav-item-mobile-text ${main_link === "/" ? " nav-item-selected" : ""}`}>Home</button>
                    </div>
                    <div className = "nav-item-mobile">
                        <button onClick = {()=> handleNavigation("work")} className = {`nav-item-mobile-text ${main_link === "/work" ? " nav-item-selected" : ""}`}>About</button>
                    </div>
                    <div className = "nav-item-mobile">
                        <button onClick = {()=>handleNavigation("skill")} className = {`nav-item-mobile-text ${main_link === "/skills" ? " nav-item-selected" : ""}`}>My Clients <i class="fas fa-sort-down"></i></button>
                    </div>
                    <div className = "nav-item-mobile">
                        <button onClick = {()=>handleNavigation("contact")} className = {`nav-item-mobile-text ${main_link === "/book" ? " nav-item-selected" : ""}`}>Contact</button>
                    </div>
                </div>
            </div>
        </div>
    )
}

HeaderMobile.propTypes = {
    setMode: PropTypes.object.isRequired
}


export default connect(null, {setMode})(HeaderMobile);
